import "./App.css";
import "./hooks/hidenMenu";
import "./hooks/yearGrid";

import HidenMenu from "./hooks/hidenMenu";
import YearGrid from "./hooks/yearGrid";

function App() {
  return (
    <div className="App">
      <div className="hidenMenuDiv">
        <HidenMenu />
      </div>
      <div className="gridSection">
        <YearGrid />
      </div>
    </div>
  );
}

export default App;
